import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
          <Route path="/student-classroom/:classId/:studentId">
            <StudentClassroomPage />
          </Route>
					<Route path="/teacher-login">
						<TeacherLoginPage />
					</Route>
          <Route path="/teacher-classroom/:classID">
            <TeacherClassroomPage />
          </Route>
          <Route path="/student-login">
            <StudentLoginPage />
          </Route>
          <Route path="/">
            <HomePage />
          </Route>
        </Switch>
      </div>
    </Router>

  );
}

export default App;
